import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
let lakesList = ["hidden", "angura", "tahoe"];

function Lake({lake}) {
  return (
    <li>{lake}</li>
  );
}

function App({lakes}) {
  return (
    <div>
      {props.lakes.map(lake => (<Lake lake={lake} />))}
    </div>
  )
}

ReactDOM.render(
  <App lakes={lakesList} />,
  document.getElementById('root')
);
